script: |
  super -f text -I q11595.spq | sort > q11595.out

inputs:
  - name: q11595.spq
    data: |
      SELECT DISTINCT + 66 AS col0 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) cor1, tab0 (FORMAT parquet) cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11595.out
    data: |
      66
